<!DOCTYPE html>
<html class="reftest-wait">
  <head>
    <title>symbols</title>
    <!-- Copyright (c) 2011 Design Science, Inc.
         License: Apache License 2.0 -->
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8"/>
    <script type="text/javascript" src="../../header.js"></script>
    <script type="text/javascript" src="../../treeReftests.js"></script>
  </head>

  <body>
    <div id="reftest-element">
      <math xmlns="http://www.w3.org/1998/Math/MathML">
        <mi mathvariant="normal">&#x2203;<!-- ∃ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x2200;<!-- ∀ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x00AC;<!-- ¬ --></mi>
        <mo stretchy="false">,</mo>
        <mo stretchy="false">&#x2227;<!-- ∧ --></mo>
        <mo stretchy="false">,</mo>
        <mo stretchy="false">&#x2228;<!-- ∨ --></mo>
        <mo stretchy="false">,</mo>
        <mspace width="thickmathspace" />
        <mo stretchy="false">&#x27F9;<!-- ⟹ --></mo>
        <mspace width="thickmathspace" />
        <mo stretchy="false">,</mo>
        <mspace width="thickmathspace" />
        <mo stretchy="false">&#x27FA;<!-- ⟺ --></mo>
        <mspace width="thickmathspace" />
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x22A4;<!-- ⊤ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x22A5;<!-- ⊥ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x2205;<!-- ∅ --></mi>
        <mo stretchy="false">,</mo>
        <mi class="MJX-variant">&#x2205;<!-- ∅ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x2202;<!-- ∂ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x221E;<!-- ∞ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x2207;<!-- ∇ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="italic">&#x210F;<!-- ℏ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="italic">&#x25A1;<!-- □ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="italic">&#x2113;<!-- ℓ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="italic">&#x0131;<!-- ı --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="italic">&#x0237;<!-- ȷ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x211C;<!-- ℜ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x2111;<!-- ℑ --></mi>
        <mo stretchy="false">,</mo>
        <mi mathvariant="normal">&#x2118;<!-- ℘ --></mi>
        <mo stretchy="false">,</mo>
        <mo stretchy="false">√</mo>
      </math>
    </div>
  </body>
</html>
